function getColorRegionHidro(Region_hid){
    switch (Region_hid) {  
      case 'Antartida':  
        return { color: "#87CEEB" };  
      case 'Cordillera Oriental - Sierras Subandinas y sus valles':  
        return { color: "#964B00" };  
      case 'Cordillera patagonica y sus valles':  
        return { color: "#3E8E41" };  
      case 'Costa Atlantica Bonaerense':  
        return { color: "#3498DB" };  
      case 'Cuenca de Bahia Blanca':  
        return { color: "#F7DC6F" };  
      case 'Entre Rios y Corrientes':  
        return { color: "#8B9467" };  
      case 'Islas Malvinas y del Atlantico Sur':  
        return { color: "#4682B4" };  
      case 'Llanos riojanos y salinas asociadas':  
        return { color: "#FFC080" };  
      case 'Llanura Chaco-Pampeana Humeda':  
        return { color: "#34C759" };  
      case 'Llanura Chaco-Pampeana arida':  
        return { color: "#FF9900" };  
      case 'Misiones':  
        return { color: "#228B22" };  
      case 'Patagonia extra-Andina':  
        return { color: "#6495ED" };  
      case 'Piedemonte y Llanura Chaco-Salteña':  
        return { color: "#CD853F" };  
      case 'Piedemonte y Llanura Cuyana':  
        return { color: "#FFA07A" };  
      case '':  
        return { color: "#8F9779" };  
      case 'Precordillera-Cordillera Frontal-Cordillera Principal y sus valles':  
        return { color: "#2F4F7F" };  
      case 'Puna':  
        return { color: "#C0C0C0" };  
      case 'Sierras Pampeanas y sus valles':  
        return { color: "#3E3E3E" };  
        case 'Piedemonte y Llanura Tucumano-Santiagueña':  
        return { color: "#fadbaa" };  
      default:  
        return { color: "#FFFFFF" }; // color por defecto si no se encuentra la categoría  
    }  
  }

  function styleRegionHidro(feature) {
    const { color } = getColorRegionHidro(feature.properties.Region_hid);
    return {
      color: color,
      weight: 2,
      opacity: 0.9,
      dashArray: "0",
      fillOpacity: 0.9,
    };
  }

// Contenido del popup para cada feature
function popupContentRegionHidro(feature) {
  return (
      "<div id='Estilo1'><h3>Descripción</h3></div>" +
      "<hr class='hrx' style='color: #ef7d26;' align='left' noshade='noshade' size='0.5' width='100%' />" +
      "<div id='Estilo3a'>" +
      "<b> Nombre : </b>" + feature.properties.Region_hid + "<br>" +
      // "<b> REGION : </b>" + feature.properties.region + "<br>" +
        "<br>" +
      "</div>"
  );
}
// leyenda
// Función para generar la leyenda
function createLegendRegionHidro() {
    var legend = L.control({ position: 'bottomright' });

    legend.onAdd = function () {
        var div = L.DomUtil.create('div', 'info legend');
        var labels = [];
        var styles = [
            { label: 'Region Hidrogeografica', color: '' },
         
           {label: 'Precordillera-Cordillera Frontal-Cordillera Principal y sus valles', color: "#2F4F7F" },
           {label:'Llanos riojanos y salinas asociadas', color: "#FFC080" },
            {label :'Sierras Pampeanas y sus valles', color: "#3E3E3E" },
           

            
        
            // Agrega aquí el resto de estilos con su respectiva etiqueta y color
        ];

        // Genera el contenido HTML de la leyenda
        styles.forEach(function (style) {
            labels.push(
                '<i style="background:' + style.color + '"></i> ' + style.label
            );
        });

        div.innerHTML = labels.join('<br>');
        return div;
    };

    // Función para mostrar/ocultar la leyenda
    function toggleLegend() {
        if (map.hasLayer(RegionesHirdo)) {
            legend.addTo(map);
        } else {
            legend.remove();
        }
    }
// Eliminar la leyenda al inicio
legend.remove();
    // Escucha el cambio de estado de la capa
    map.on('overlayadd overlayremove', toggleLegend);
}


